columnDataChange.oldValue:
(coalesce((select case when sum(abs(ol.qtyordered)) = 0 then 0 else 
round(coalesce(sum(abs(ol.qtyinvoiced)), 0)/sum(abs(ol.qtyordered)) * 100, 0)  end 
from c_orderline ol   where ol.c_order_id=c_order_id and  ol.c_order_discount_id is null), 0))

columnDataChange.newValue:
(coalesce((select case when sum(abs(ol.qtyordered)) = 0 then 0 else 
floor(coalesce(sum(abs(ol.qtyinvoiced)), 0)/sum(abs(ol.qtyordered)) * 100)  end 
from c_orderline ol   where ol.c_order_id=c_order_id and  ol.c_order_discount_id is null), 0))
